import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Login from './components/Login';
import Home from './components/Home';
import Addclient from './components/clientsForm';

const App = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  // Check if the user is authenticated when the app mounts
  useEffect(() => {
    const authStatus = localStorage.getItem('isAuthenticated');
    if (authStatus === 'true') {
      setIsAuthenticated(true);
    }
  }, []); // Empty dependency array to run only once when the component mounts

  return (
    <>
       <div className="flex h-screen flex-col">
      {/* Top Navbar */}
      <div className="bg-gradient-to-r from-pink-500 to-violet-800 p-4 flex justify-between items-center shadow-md">
        {/* Left Menu */}
        <div className="flex space-x-6">
          <button
            onClick={() => navigate("/home")}
            className="text-white px-4 py-2 rounded-md hover:bg-pink-600 transition-colors"
          >
            Home
          </button>
          <button
            onClick={() => navigate("/templates")}
            className="text-white px-4 py-2 rounded-md hover:bg-pink-600 transition-colors"
          >
            Templates
          </button>
          <button
            onClick={() => navigate("/addclient")}
            className="text-white px-4 py-2 rounded-md hover:bg-pink-600 transition-colors"
          >
            Add Client
          </button>
        </div>

        {/* Right Menu (Logout) */}
        <Logout />
      </div>

      {/* Sidebar Navbar */}
      <div className="flex flex-1">
        <nav className="bg-blue-900 w-64 p-4">
          {/* Navigation Links */}
          <ul className="space-y-4">
            <li>
              <button
                onClick={() => navigate("/design-engineering")}
                className="block text-white px-4 py-2 rounded-md hover:bg-blue-300 transition-colors"
              >
                Design Engineering
              </button>
            </li>
            <li>
              <button
                onClick={() => navigate("/pmc")}
                className="block text-white px-4 py-2 rounded-md hover:bg-blue-300 transition-colors"
              >
                PMC
              </button>
            </li>
            <li>
              <button
                onClick={() => navigate("/pre-bid")}
                className="block text-white px-4 py-2 rounded-md hover:bg-blue-300 transition-colors"
              >
                Pre Bid
              </button>
            </li>
            <li>
              <button
                onClick={() => navigate("/operational-management")}
                className="block text-white px-4 py-2 rounded-md hover:bg-blue-300 transition-colors"
              >
                Operational Management
              </button>
            </li>
            <li>
              <button
                onClick={() => navigate("/knowledge-management")}
                className="block text-white px-4 py-2 rounded-md hover:bg-blue-300 transition-colors"
              >
                Knowledge Management
              </button>
            </li>
          </ul>
        </nav>

        <main className="flex-1 bg-gradient-to-r from-blue-200 to-blue-400 p-4">
          {/* Main Content */}
          <h2 className="text-3xl font-bold text-center text-white">
            Main Content Here
          </h2>
        </main>
      </div>
    </div>
      <Routes>
        <Route path="/" element={<Login setIsAuthenticated={setIsAuthenticated} />} />
        <Route
          path="/home"
          element={isAuthenticated ? <Home /> : <Navigate to="/" replace />}
        />
        <Route path="/addclient" element={<Addclient/>}/>
      </Routes>
    </>
  );
};

export default function MainApp() {
  return (
      <Router>
          <App />
      </Router>
  );
}
